import React, { Component } from 'react';
import { connect } from "react-redux";


class App extends Component {

    render() {
        return (
            <div>
                App
            </div>
        )
    }

    mapStateToProps = (state) =>  {
        console.log(state)
    }  
}


export default connect(mapStateToProps , {fetchData})(App);;
